import './App.css';

class App extends React.Component {

constructor(props){
  super(props);
  this.state={
    title:'Deekshith',
    headLines:[
      {title: 'Home', path:'/'},
      {title: 'About', path:'/about'},
      {title: 'contact', path:'/contact'},
    ]
  }
}

  render() {
    return (
      <div>Hi Deekshith</div>
    );
  }
}

export default App;
